def sensitive():
    global redmineUrl
    global nextCloudUrl
    global user_to_vacation_keywords
    
    # load sensitive data
    path = os.path.dirname(os.path.realpath(__file__))
    sensitivePath = os.path.join(path, 'sensitive.json')
    
    data = {}
    try:
        with open(sensitivePath, 'r', encoding='utf8') as sensitive:
            if sensitive:
                data = json.load(sensitive)
                if not 'redmineUrl' in data or len(data['redmineUrl']) == 0:
                    raise Exception("No redmineUrl in sensitive.json")
                else:
                    redmineUrl = data['redmineUrl']
                if not 'nextCloudUrl' in data or len(data['nextCloudUrl']) == 0:
                    raise Exception("No nextCloudUrl in sensitive.json")
                else:
                    nextCloudUrl = data['nextCloudUrl']
                if not 'userToVacDict' in data or len(data['userToVacDict']) == 0:
                    raise Exception("No userToVacDict in sensitive.json")
                else:
                    user_to_vacation_keywords = data['userToVacDict']
            else:
                raise Exception("No sensitive.json or no data in it!")
    except Exception as e:
        print("Fatal error: " + str(e))
        sys.exit()

