#-----------------------------------------------------------------------
# Redmine log-in thread
def _loginRed_thread(*args):
    global mutex
    global redmine
    global redmineUrl
    thread_data = threading.local()
    thread_data.result = False
    
    if mutex.acquire(False):
        try:
            if len(args[0]) == 1:
                redmine = Redmine(redmineUrl, key=args[0][0], requests={'verify': False})
            else:
                redmine = Redmine(redmineUrl, username=args[0][0], password=args[0][1], requests={'verify': False})
            redmine.user.get('current').id
            thread_data.result = True
            print("loginRed: Success")
        except:
            thread_data.result = False
            print("loginRed: Failure")
        finally:
            mutex.release()

    return thread_data.result
    
#-----------------------------------------------------------------------
# NextCloud log-in thread
def _loginNext_thread(*args):
    global mutex
    global calendar
    global nextCloudUrl
    thread_data = threading.local()
    thread_data.result = False
    
    if mutex.acquire(False):
        try:
            calendar = caldav.DAVClient(url=nextCloudUrl, username=args[0][0], password=args[0][1])
            principal = calendar.principal()
            thread_data.result = True
            print("loginNext: Success")
        except:
            thread_data.result = False
            print("loginNext: Failure")
        finally:
            mutex.release()

    return thread_data.result

