#-----------------------------------------------------------------------
# Redmine get filterTimeEntry thread
def _filterTimeEntry_thread(*args):
    global mutex
    global redmine
    global dateFormat
    thread_data = threading.local()
    thread_data.result = 0.0
    
    if mutex.acquire(False):
        try:
            for p in args[0][0]:
                thread_data.projectId = redmine.project.get(resource_id=args[0][1][p]).id
                for t in list(redmine.time_entry.filter(project_id=thread_data.projectId, user_id=args[0][4], from_date=date(*(time.strptime(args[0][2], dateFormat)[0:3])), to_date=date(*(time.strptime(args[0][3], dateFormat)[0:3])))):
                    thread_data.result += t.hours
                print("timeQueryRed: Success")
        except:
            thread_data.result = 0.0
            print("timeQueryRed: Failure")
        finally:
            mutex.release()
        
    return thread_data.result
    
#-----------------------------------------------------------------------
# NextCloud get vacDaysQuery thread
def _vacDaysQuery_thread(*args):
    global mutex
    global dovolene
    global dateFormat
    global user_to_vacation_keywords
    thread_data = threading.local()
    thread_data.result = 0.0
    
    if dovolene:
        if mutex.acquire(False):
            try:
                dateFrom = date(*(time.strptime(args[0][0], dateFormat)[0:3]))
                dateTo = date(*(time.strptime(args[0][1], dateFormat)[0:3]))
                results = dovolene.date_search(start=dateFrom, end=dateTo)
                svatky = list(holidays.CZ(years=[dateFrom.year, dateTo.year]).keys())
                for e in results:
                    duration = 0.0
                    try:
                        startDate = e.vobject_instance.vevent.dtstart.value
                        endDate = e.vobject_instance.vevent.dtend.value
                        for i in range(0, (e.vobject_instance.vevent.dtend.value - e.vobject_instance.vevent.dtstart.value).days):
                            currentDate = startDate + timedelta(days=i)
                            if (currentDate.weekday() < 5) and currentDate not in svatky:
                                duration += 1.0
                        #duration = float((e.vobject_instance.vevent.dtend.value - e.vobject_instance.vevent.dtstart.value).days)
                    except:
                        duration = 1.0
                    summary = e.vobject_instance.vevent.summary.value
                    for i in user_to_vacation_keywords[str(args[0][2])]:
                        if i in summary:
                            if any(i in e.data for i in ["1/2", "0.5", "0,5", "pul", "půl", "pol", "pól"]):
                                thread_data.result += 0.5 
                            else:
                                thread_data.result += duration
                    
                print("vacDaysNext: Success")
            except:
                thread_data.result = 0.0
                print("vacDaysNext: Failure")
            finally:
                mutex.release()
        
    return thread_data.result

