#-----------------------------------------------------------------------
# Wrapper for prolonged operations on APIs
def performProlongedCall(opProcedure, opArgs, msg, location=(None, None)):
    global animation
    result = None
    
    #layout = [ [sg.Image(data=animation, key='_IMAGE_')] ]
    #window = sg.Window('', layout, icon=app_icon, no_titlebar=True)
    #window.finalize()
    
    que = Queue()
   
    thread = Thread(target=lambda q, arg1: q.put(opProcedure(arg1)), args=(que, opArgs), daemon=True)
    thread.start()

    thread.join(timeout=1/5)
    if thread.is_alive():
        while True:
            sg.popup_animated(image_source=animation, message=msg, time_between_frames=40, location=location, keep_on_top=False)
            #window.Element('_IMAGE_').UpdateAnimation(animation, time_between_frames=tbf)
            #window.refresh()
            thread.join(timeout=.04)
            if not thread.is_alive():
                break
        sg.popup_animated(None)
        #window.Close()
        try:
            result = que.get_nowait()
        except queue.Empty:
            result = None
            
            #try:
            #    try:
            #        result = que.get_nowait()  # see if something has been posted to Queue
            #        break
            #    except:  # get_nowait() will get exception when Queue is empty
            #        result = None
            #        sg.popup_animated(image_source=animation, message=msg, time_between_frames=tbf)
            #except:
            #    pass
        #sg.popup_animated(image_source=None)    # stop running the animation
        #thread.join()
        
        
    else:
        try:
            result = que.get_nowait()  # see if something has been posted to Queue
        except queue.Empty:  # get_nowait() will get exception when Queue is empty
            result = None

    return result

