# Login to Redmine using API key (if available) or credentials
def logInRed():
    global redmine
    
    # load config - check whether credentials are available
    path = os.path.join(os.environ['APPDATA'], 'RedHours')
    if not os.path.exists(path):
        os.makedirs(path)
    
    configPath = os.path.join(path, 'config.json')
    
    # flag - credentials loaded / should be stored?
    store = True
    
    # connect to Redmine, provide versions in order to access full capabilities of the Rest API, provide key for login and turn off SSL certificate check
    data = {}
    try:
        with open(configPath, 'r') as config:
            if config:
                data = json.load(config)
                if not 'redmine' in data or len(data['redmine']) == 0:
                    raise Exception("No data in JSON")
                else:
                    apiKey = data['redmine']['apiKey']
                    
                    real_args = [apiKey]

                    store = performProlongedCall(_loginRed_thread, real_args, "Přihlašuji....")
            else:
                store = False
    except:
        redmine = None
        store = False
        data['redmine'] = {}
        data['redmine']['apiKey'] = ''
        with open(configPath, 'w') as config:
            json.dump(data, config)
    
    if not store:
        # if api key isn't specified or does not work, create credentials window
        layout = [
                   [sg.Image(data=red_icon), sg.Text('Přihlášení do Redmine:')],
                   [sg.Text('Login', size=(10, 1)), sg.In(size=(15, 1))],
                   [sg.Text('Password', size=(10, 1)), sg.In(size=(15, 1), password_char="*")],
                   [sg.Button('Ok', bind_return_key=True), sg.Button('Zrušit')],
                   [sg.Checkbox('Ulož přihlašovací údaje (API klíč)', default=True)]
                 ]
        event, values = sg.Window('Prihlašovací údaje do Redmine', layout, icon=app_icon).read(close=True)
               
        if event in('Zrušit', event==sg.WIN_CLOSED):
            return False
        
        store = values[3]
        try:
            real_args = [values[1], values[2]]
            
            store = performProlongedCall(_loginRed_thread, real_args, "Přihlašuji....")
        except:
            redmine = None
            sg.popup('Varování', "Nelze připojit k Redmine!")
            return False
    
        if store:
            data['redmine']['apiKey'] = performProlongedCall(_apiKey_thread, [], "Přihlašuji....")
            with open(configPath, 'w') as config:
                json.dump(data, config)
    
    return True

